#include "MFZAvatarGenMdlFemaleInvVerts.hpp"

using namespace mfz_avatar_gen;

// Class methods

mdl_female_inv_verts::mdl_female_inv_verts(void) : m_female_vertices_inv(c_female_vertices_inv, c_female_vertices_inv + sizeof(c_female_vertices_inv) / sizeof(double)),
                                                   m_female_sv_inv(N_VERTS_INV_3, std::vector<double>(N_MU, 0))
{
    // Sv
    for (unsigned int i = 0; i < N_VERTS_INV_3; ++i) {
        for (unsigned int j = 0; j < N_MU; ++j) {
            m_female_sv_inv[i][j] = c_female_sv_inv[i][j];
        }
    }
}

std::vector<double> &mdl_female_inv_verts::getInvVerts(void) const {
    return const_cast<std::vector<double>&>(m_female_vertices_inv);
}

std::vector< std::vector<double> > &mdl_female_inv_verts::getInvSv(void) const {
    return const_cast<std::vector< std::vector<double> >&>(m_female_sv_inv);
}

